import { SoccerPlayer } from "./Components/SoccerPlayer";
import { Ball } from "./Components/ball";
import React from "react";
import "./App.css";
import Vector2 from "./Components/Vector2";
import bg from "./halisaha.png";

const kaleciTypes = {
  coordinate: {
    min: new Vector2(0, 0), // Minimum koordinat
    max: new Vector2(2, 2), // Maksimum koordinat
  },
  datas: [
    { name: "Kaleci", shortName: "K", Props: ["Savunma"] },
    {
      name: "Libero Kaleci",
      shortName: "LK",
      Props: ["Savunma", "Destek", "Hücum"],
    },
  ],
};
const stoperTypes = {
  coordinate: new Vector2(1, 1),
  datas: [
    {
      name: "Standart Stoper",
      shortName: "SS",
      Props: ["Savunma", "Kesici", "Sigorta"],
    },
    { name: "Libero", shortName: "L", Props: ["Savunma", "Destek"] },
    {
      name: "Pasör Stoper",
      shortName: "PS",
      Props: ["Savunma", "Kesici", "Sigorta"],
    },
    {
      name: "Çakılı Stoper",
      shortName: "ÇS",
      Props: ["Savunma", "Kesici", "Sigorta"],
    },
    {
      name: "Kenar Stoper",
      shortName: "KS",
      Props: ["Savunma", "Kesici", "Sigorta"],
    },
  ],
};

const defansOrtaSahaTypes = {
